import { Link } from 'react-router-dom';
const Navbar = () => {
  return (
    <nav>
      <li>
        <Link to='/'>KnowledgeOfMan.com</Link>
      </li>
      <li>
        <Link to='/about'>About</Link>
      </li>
    </nav>
  );
};

export default Navbar;
